import './App.css';
import PrimarySearchAppBar from './components/AppBar';
import { Typography } from '@material-ui/core';
import Box from '@material-ui/core/Box';

function App() {
  return (
    <div className="App">
      <PrimarySearchAppBar/>
      <Box mt={ 4 }>
        <Typography variant="h4" component="h4">
          Learning <code>React</code>, Woo!
        </Typography>
      </Box>
    </div>
  );
}

export default App;
